-- === FUNGSI ===
local function getChar()
	local char = player.Character or player.CharacterAdded:Wait()
	local hum = char:WaitForChild("Humanoid")
	local hrp = char:WaitForChild("HumanoidRootPart")
	return char, hum, hrp
end

local function loadFromJSON(text)
	local ok, decoded = pcall(function()
		return HttpService:JSONDecode(text)
	end)
	if not ok then
		warn("[] Format JSON tidak valid!")
		return false
	end

	movementData = {}
	for _, d in ipairs(decoded) do
		table.insert(movementData, {
			t = d.t or 0,
			cf = CFrame.new(unpack(d.cf)),
			state = Enum.HumanoidStateType[d.state] or Enum.HumanoidStateType.Running,
			dir = Vector3.new(d.dir.x, d.dir.y, d.dir.z),
			speed = d.speed or 16
		})
	end

	print("[] Rekaman berhasil dimuat (" .. #movementData .. " frame)")
	return true
end

local function playReplay(callback)
	local char, hum, hrp = getChar()
	local controls
	pcall(function()
		local pm = require(player:WaitForChild("PlayerScripts"):WaitForChild("PlayerModule"))
		if pm and pm.GetControls then
			controls = pm:GetControls()
		end
	end)
	if controls then controls:Disable() end
	hum.PlatformStand = true

	local start = os.clock()
	local total = movementData[#movementData].t
	if heartbeatConn then heartbeatConn:Disconnect() end

	heartbeatConn = RunService.Heartbeat:Connect(function()
		if not replaying then
			if heartbeatConn then heartbeatConn:Disconnect() end
			if controls then controls:Enable() end
			hum.PlatformStand = false
			return
		end

		local elapsed = os.clock() - start
		if elapsed >= total then
			if heartbeatConn then heartbeatConn:Disconnect() end
			if controls then controls:Enable() end
			hum.PlatformStand = false
			if callback then callback() end
			return
		end

		local i = 1
		while i < #movementData and movementData[i+1].t < elapsed do
			i += 1
		end

		local a, b = movementData[i], movementData[i+1]
		if not a or not b then return end

		local alpha = (elapsed - a.t) / math.max((b.t - a.t), 0.0001)
		local cf = a.cf:Lerp(b.cf, alpha)
		hum:ChangeState(a.state)
		hum.WalkSpeed = a.speed
		hum:Move(a.dir, true)
		hrp.CFrame = cf
	end)
end

