local function makeBtn(text, posY, emoji)
	local b = Instance.new("TextButton")
	b.Size = UDim2.new(0.9, 0, 0, 30)
	b.Position = UDim2.new(0.05, 0, 0, posY)
	b.BackgroundColor3 = Color3.fromRGB(60, 60, 70)
	b.BackgroundTransparency = 0.3
	b.TextColor3 = Color3.new(1, 1, 1)
	b.Font = Enum.Font.SourceSansSemibold
	b.TextSize = 14
	b.Text = emoji .. " " .. text
	b.BorderSizePixel = 0
	local btnCorner = Instance.new("UICorner", b)
	btnCorner.CornerRadius = UDim.new(0, 8)
	b.Parent = frame
	b.MouseEnter:Connect(function()
		TweenService:Create(b, TweenInfo.new(0.2), {BackgroundTransparency = 0.1}):Play()
	end)
	b.MouseLeave:Connect(function()
		TweenService:Create(b, TweenInfo.new(0.2), {BackgroundTransparency = 0.3}):Play()
	end)
	return b
end

local loadBtn = makeBtn("Load JSON", 60, "")
local playBtn = makeBtn("Play", 100, "")
local loopBtn = makeBtn("Loop: OFF", 140, "")

loadBtn.MouseButton1Click:Connect(function()
	loadBtn.Text = " Loading..."
	if loadFromJSON(JSON_DATA) then
		loadBtn.Text = " Loaded!"
	else
		loadBtn.Text = " Failed"
	end
	task.wait(1.5)
	loadBtn.Text = " Load JSON"
end)

playBtn.MouseButton1Click:Connect(function()
	if #movementData < 2 then
		warn("Belum ada data! Tekan 'Load JSON' dulu.")
		return
	end
	if replaying then
		replaying = false
		playBtn.Text = " Play"
		return
	end
	replaying = true
	playBtn.Text = " Stop"
	task.spawn(function()
		while replaying do
			playReplay(function()
				if loopReplay and replaying then
					task.wait(0.5)
				else
					replaying = false
				end
			end)
			repeat task.wait() until not heartbeatConn or not heartbeatConn.Connected
		end
		playBtn.Text = " Play"
	end)
end)

loopBtn.MouseButton1Click:Connect(function()
	loopReplay = not loopReplay
	loopBtn.Text = loopReplay and " Loop: ON" or " Loop: OFF"
end)

